<p style="text-align: justify;"><span style="font-family: Arial, sans-serif;"><span style="font-size: 14px;">On January 28th to 30th, 2015, Accor Asia Pacific held its annual General Manager conference in Bali. This important event was held in Sofitel, Nusa Dua and attended by more than 100 hotel executives from Indonesia, Malaysia, and Singapore. Throughout the meeting, Accor’s future expansion plan was a hot topic of discussion. In order to achieve this goal, especially in expanding the Indonesian market, Accor has gotten full support from business partners. To such effect, the participation of Accor’s partners such as PT. Telkom, King Koil, Philips, and PT. Realta Chakradarma is prominent. The presence of REALTA is not surprising since its product, Rhapsody Hospitality System has been chosen as Accor’s recommended solution for quite some time. In fact, almost all of Accor hotels in Indonesia use Rhapsody as its Property Management System (PMS). In the future Accor contemplating the expansion of this partnership by using Rhapsody Hospitality Management System for its South East Asian hotels, particularly Malaysia, Singapore, and Thailand.</span></span></p>
<p> </p>
<p><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Calibri'',''sans-serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><img src="images/IMG_3581.jpg" alt="" border="0" /><img style="display: block; margin-left: auto; margin-right: auto;" src="images/blog/accor_realta_rhapsody_2.jpg" alt="" /><br /></span></p>
<p style="text-align: justify;"><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Calibri'',''sans-serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"> </span></p>
<p class="MsoNormal" style="text-align: center;" align="center"><strong><em><span style="font-size: 15.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; color: #7030a0;">“The bond between Accor and REALTA is founded upon mutual benefits and leads to a commitment for continuous growth and advancement.”</span></em></strong></p>
<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Arial'',''sans-serif'';">For Accor, REALTA’s quality and capacity to provide a comprehensive solution which includes software, hardware, and network infrastructure, is an assurance that the hotel’s ICT (Information &amp; Communication Technology) system will be delivered properly and punctually. In 2013 to 2014, Accor International finalized its development of the Front Office Light System (FOLS) application and appointed REALTA to be their implementation partner. Within a short period this collaboration resulted in a full integration between FOLS and Rhapsody Hospitality System. The new system, referred to as FOLS-Rhapsody has been subsequently implemented at a number of Ibis and Ibis Style hotels. This latest success is another significant achievement that strengthens the partnership of Accor and REALTA.</span></p>
<p><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Calibri'',''sans-serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: ''Times New Roman''; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"> <img style="display: block; margin-left: auto; margin-right: auto;" src="images/blog/accor_realta_rhapsody_1.jpg" alt="" /></span></p>
<p> </p>
<p><a href="pricing"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/rhapsody_20.png" alt="" /></a></p>',1,'2018-09-19 04:01:55',NULL,'2021-03-24 03:21:16','2018-09-19 04:01:55','0000-00-00 00:00:00','{"image_intro":"images\\/blog\\/Accor-Hotels-Group-x-Realta.jpg","float_intro":"none","image_intro_alt":"annual general manager conference","image_intro_caption":"","image_fulltext":"images\\/blog\\/Accor-Hotels-Group-x-Realta.jpg","float_fulltext":"none","image_fulltext_alt":"annual general manager conference","image_fulltext_caption":""}','{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}','{"article_layout":"","show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","info_block_show_title":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_associations":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_page_title":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":"","spfeatured_image":"","spfeatured_image_alt":"","post_format":"standard","gallery":"","audio":"","video":"","link_title":"","link_url":"","quote_text":"","quote_author":"","post_status":""}',17,'General Manager conference, pms. property management system, sistem hotel, pms hotel, hospitality in management','Accor Asia Pacific held its annual General Manager conference in Bali and attended by more than 100 hotel executives from ASEAN Countries',55016,'{"robots":"","author":"","rights":"","xreference":""}','*',NULL,NULL,'admin','louis','blog',1,0,23,7,'/hospitality-system/blog/article-news/84-accor-cooperation-with-realta','',